import React, { useEffect, useState } from "react";

function MyAccount() {
    const [user, setUser] = useState()

    useEffect(() => {
        fetch("/my_account")
        .then((res) => res.json())
        .then((res) => setUser(res))
    }, [])

    return (
        <div>
            <h1>Hello {user.username}!</h1>

            <div>
                <button>POSTS</button>
                <button>ANIMALS</button>
            </div>
        </div>
    )
}

export default MyAccount;
